import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import Navbar from './component/Navbar';
import Home from './components/Home';
import TutorHome from './components/TutorHome';
import AdminHome from './components/AdminHome';
import ClassDetail from './components/ClassDetail';
import PrivateRoute from './components/PrivateRoute';

const App = () => {
  return (
    <Router>
      <div>
      <Navbar />
      <Routes>
        <Route path="/register" element={<Register />} />
        <Route path="/" element={<Login />} />
        <Route path="/home" element={<PrivateRoute><Home /></PrivateRoute>} />
        <Route path="/tutorhome" element={<PrivateRoute><TutorHome /></PrivateRoute>} />
        <Route path="/adminhome" element={<PrivateRoute><AdminHome /></PrivateRoute>} />
        <Route path="/classes/:classId" element={<PrivateRoute><ClassDetail /></PrivateRoute>} />
      </Routes>
      </div>
    </Router>
  );
};

export default App;
